import React, { useEffect, useState } from "react";
import axios from "axios";
import './App.css';


function App() {
  const [eName, seteName] = useState([])
  const [employeeEmail, setEmployeeEmail] =useState([])
  const [ePic,setePic] = useState([]);

  useEffect(()=> {
    load
  })


  const geteName = () => {
    fetch('https://randomuser.me/api/?results=50')
    .then ((res) => res.json())
    .then((data)=> {
      console.log(data);
      seteName(data.results[0].name.first + " " + data.results[0].name.last);
      setEmployeeEmail(data.results[0].email);
      setePic(data.results[0].picture.thumbnail);
    })
  };




  return (
    <div>
    <button onClick={geteName}>Get Employee</button>


    <table class="table-auto">
  <thead>
    <tr>
      <th class="border border-green-600">Photo</th>
      <th class="border border-green-600">Name</th>
      <th class="border border-green-600">Email</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <td class="border-collapse border-green-600"><img src={ePic}></img></td>
      <td class="border border-green-600">{eName}</td>
      <td class="border border-green-600">{employeeEmail}</td>
    </tr>
    <tr class="bg-emerald-200">
      <td class="border border-green-600"><img src={ePic}></img></td>
      <td class="border border-green-600">{eName}</td>
      <td class="border border-green-600">{employeeEmail}</td>
    </tr>
    <tr>
      <td></td>
      <td></td>
      <td></td>
    </tr>
  </tbody>
</table>
    </div>


    // <Router>
    //   <div>
    //       <Route exact path="/" component={User} />

    //   </div>
    // </Router>

  );
}

export default App;
